<template>
  <div>
    <div class="mt-4">
      <v-simple-table height="400px">
        <template v-slot:default>
          <thead>
            <tr>
              <th class="text-left">JMBAG</th>
              <th class="text-left">Ime i prezime</th>
              <th class="text-left">E-mail</th>
              <th class="text-left">Odabir 1 </th>
              <th class="text-left">Odabir 2 </th>
              <th class="text-left">Odabir 3 </th>
              <th class="text-left">Konaƒçni odabir </th>
              <th class="text-left"> </th>
            </tr>
          </thead>
          <tbody>
            <tr v-for="item in projekti" :key="item.id">
              <td>{{ item.jmbag }}</td>
              <td>{{ item.ime }} {{ item.prezime }}</td>
              <td>{{ item.email }}</td>
              <td>{{ item.odabir1_ime_projekta }} </td>
              <td>{{ item.odabir2_ime_projekta }} </td>
              <td>{{ item.odabir3_ime_projekta }} </td>
              <td>
                <b-form-select size="sm" v-model="odabir">
                  <option v-bind:value="item.odabir1_ime_projekta">Odabir 1</option>
                  <option v-bind:value="item.odabir2_ime_projekta">Odabir 2</option>
                  <option v-bind:value="item.odabir3_ime_projekta">Odabir 3</option>
                </b-form-select>
              </td>
              <td>
                <b-button v-b-popover.hover.top="'Preuzmi PDF'" type="submit" variant="secondary" size="sm" style="background-color: #102847;" @click="generatePDF((item.id)-1)">
                  <b-icon-download></b-icon-download>
                </b-button>
              </td>      
            </tr>  
          </tbody>
        </template>
      </v-simple-table>
    </div>
  </div>
</template>

<script>
import axios from 'axios';
import jspdf from 'jspdf';
import jwtDecode from 'jwt-decode';

export default {
  name: "TableSimpleFixHeight",

  data() {
    const token = localStorage.usertoken;
    const decoded = jwtDecode(token);
    return {
      ime: decoded.identity.ime,
      prezime: decoded.identity.prezime,
      projekti:[],
      odabir: '',
    };
  },

  methods: {
    generatePDF(i){
      let doc = new jspdf();
      doc.text('Sveuciliste Jurja Dobrile u Puli', 70, 35);
      doc.text('OBRAZAC ZA ODABIR STUDENTSKE PRAKSE', 50, 65);
      doc.text('Ime: ' + this.projekti[i].ime, 15, 85);
      doc.text('Prezime: ' + this.projekti[i].prezime, 15, 100);
      doc.text('E-mail: ' + this.projekti[i].email, 15, 115);
      doc.text('Vrsta studija: ' + this.projekti[i].vrsta_studija, 15, 130);
      doc.text('JMBAG: ' + this.projekti[i].jmbag, 15, 145);
      doc.text('Studijski smjer: ' + this.projekti[i].smjer, 15, 160);
      doc.text('Zadatak i poduzece: ' + this.odabir, 15, 175);
      doc.text('Profesor: ' + this.ime + ' ' + this.prezime, 15, 190);
      doc.text('Datum _______________', 15, 280);
      doc.text('_________________', 140, 210);
      doc.text('  (potpis poduzeca)', 140, 220);
      doc.text('_________________', 140, 240);
      doc.text('  (potpis profesora)', 140, 250);
      doc.text('_________________', 140, 270);
      doc.text('  (potpis studenta/ice)', 140, 280);

      var imgData = 'data:image/jpeg;base64,';
      doc.addImage(imgData, 'JPEG', 0, 12, 65, 40);

      doc.save("konacni-odabir.pdf");
    },
    getProjects() {
      axios.get('http://localhost:8000/odabir').then((response) => {
        this.projekti = response.data;
      })
      .catch((e) => {
        console.error(e);
      });
    },
  },

  created() {
    this.getProjects();
  },
};
</script>